import React, {useState, useEffect} from "react";
import "./Tickers.css";

var chartData = new Map([
    ["GTBY", [0]],
    ["APPL", [0]],
    ["TSLA", [0]],
    ["UAL", [0]],
    ["MRNA", [0]],
])

function Tickers() {

    const topStocks = ["GTBY", "APPL", "TSLA", "UAL", "MRNA"];
    const [data, setData] = useState([]);

    useEffect(() => {
        setTimeout(() => {
        fetch("http://localhost:9000/stockAPI/")
            .then(response => response.json())
            .then(data => setData(data));
        chartData.get("GTBY")
        console.log(data);
        }, 2000);
    });


    return (
        <div className="tickers_wrapper">
            <div className="tickers_heading">
                Top 5 Stocks ðŸ”¥
            </div>
            <div className="tickers_list">
                <button className="tickers_stock">
                    <div>GTBY</div>
                    <div>{data[0].price}</div>
                </button>
                <Bar />
                <button className="tickers_stock">
                    <div>APPL</div>
                    <div>{data[1].price}</div>
                </button>
                <Bar />
                <button className="tickers_stock">
                    <div>TSLA</div>
                    <div>{data[2].price}</div>
                </button>
                <Bar />
                <button className="tickers_stock">
                    <div>UAL</div>
                    <div>{data[3].price}</div>
                </button>
                <Bar />
                <button className="tickers_stock">
                    <div>MRNA</div>
                    <div>{data[4].price}</div>
                </button>
            </div>
        </div>
    )
}

function Bar(){
    return(
        <hr  style={{
            borderColor: '#869196',
            height: .05,
            width: 225,
        }}/>
    )
}





export default Tickers
